  "content": "<h4><font face=\"Tahoma\">Thịt heo Nova Safe Foods được sản xuất từ đàn heo nuôi trong các nông trại Anova Farm theo chuẩn Global Gap. Hiện nay tại Việt nam chỉ có duy nhất nông trại Anova Farm đạt được tiêu chuẩn quốc tế này trên heo.<br> Đàn heo được nuôi bằng thức ăn cung cấp từ nhà máy thức ăn Anova Feed (đạt chuẩn Global Gap) và sử dụng các loại vaccine, thuốc thú y nhập khẩu, sản xuất bởi các công ty thành viên của tập đoàn Anova đạt tiêu chuẩn WHO-GMP. Heo được giết mổ và đóng gói theo tiêu chuẩn vệ sinh an toàn thực phẩm HACCP tại nhà máy Le Boucher.<br> Từ khâu nuôi heo giống, heo nái, heo thịt cho đến giết mổ, pha lóc đóng gói là một quy trình khép kín và có thể truy xuất nguồn gốc, đảm bảo thịt heo Nova Safe Foods là sản phẩm an toàn, không chứa chất cấm, dư lượng kháng sinh và giàu dinh dưỡng.<\/font><\/h4> \n<p class=\"MsoNormal\"> \n <o:p><\/o:p><\/p> \n<p class=\"MsoNormal\"> \n <o:p><\/o:p><\/p> \n<p class=\"MsoNormal\"> \n <o:p><\/o:p><\/p>",
